import React from 'react';

function AboutSection() {
    return (
        <div className="about-section">
            <h2>About Us</h2>
            <p>
                We are dedicated to providing the best services and solutions to our clients. Our team is composed of experienced professionals who are passionate about their work.
            </p>
        </div>
    );
}

export default AboutSection;
